// ***WEATHER API FOR TESTING***
import axios from 'axios';

baseURL = 'https://api.openweathermap.org/data/2.5/weather?q=Boston&appid=c6486faa83439ea438ec474fb38476d2&units=imperial'
export const getWeatherData = async () => {
    try {
        const { data } = await axios.get(baseURL);
        return data;
    } catch (error) {
        throw error;
    }
}
